package services;import model.DestinatarEntity;import model.repository.DestinatarRepository;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import java.util.List;@Servicepublic class DestinatarServiceImpl implements DestinatarService {    @Autowired    private DestinatarRepository destinatarRepository;    @Override    public List<DestinatarEntity> findAllDestinatari() {        return (List<DestinatarEntity>) destinatarRepository.findAll();    }    @Override    public DestinatarEntity save(DestinatarEntity destinatar) {        return destinatarRepository.save(destinatar);    }}